/* harmony default export */ __webpack_exports__["default"] = ("---\r\ntitle: \"타입스크립트 실습 QUIZ\"\r\ndate: \"2021.04.28\"\r\ntags: \r\n  - typescript\r\n---\r\n# 나를 위해 내가 직접 만든 QUIZ\r\n\r\n## Q1. 다음 빈칸에 들어갈 알맞은 것은?\r\n\r\n```jsx\r\nfunction joinStudy(name: string, age: number): ( 빈칸 ) {\r\n  if (age > 23) {\r\n    console.log(name)\r\n  }\r\n}\r\njoinStudy('John Doe', 35)\r\n```\r\n\r\n\r\n\r\n## Q2. 아래 arr는 숫자로 이루어진 배열이고 수정이 불가능하다. 이때 빈칸에 들어갈 것으로 가장 알맞은 것은?\r\n\r\n```jsx\r\nlet arr: (      빈칸     ) = [1,2,3];\r\n```\r\n\r\n\r\n\r\n## Q3. OX퀴즈\r\n\r\n- (   ) 클래스끼리는 상속이 가능하지만 인터페이스간에는 상속이 불가능하다.\r\n- (   ) enum은 javascript로 컴파일 된 후에도 남아있다.\r\n\r\n\r\n\r\n## Q4. 다음중 Capt 타입은 어떤 모습인가?\r\n\r\n```jsx\r\ninterface Person {\r\n  name: string;\r\n  age: number;\r\n}\r\ninterface Developer {\r\n  name: string;\r\n  skill: number;\r\n}\r\ntype Capt = Person & Developer;\r\n\r\n```\r\n\r\n```jsx\r\n// Capt타입\r\n{\r\n\t// 여기에 답안을 작성해주세요.\r\n\t\r\n\t\r\n}\r\n```\r\n\r\n\r\n\r\n## Q5. 다음 빈칸에 들어갈 수 있는 것을 모두 작성해주세요.\r\n\r\n```jsx\r\ninterface Animal{\r\n  name: string;\r\n\tage: number,\r\n  move: number;\r\n}\r\ninterface Bird{\r\n  name: string;\r\n\tage: number;\r\n  fly: string;\r\n}\r\nfunction hawk(sth: Animal & Bird) {\r\n // 여기에 답안을 작성해주세요.\r\n}\r\n```\r\n\r\n\r\n\r\n## Q6. 다음 코드가 console에 출력되는 결과는 무엇일까요?\r\n\r\n```jsx\r\nclass Animal {\r\n    name: string;\r\n    constructor(theName: string) { this.name = theName; }\r\n    move(distanceInMeters: number = 0) {\r\n        console.log(`${this.name} moved ${distanceInMeters}m.`);\r\n    }\r\n}\r\n\r\nclass Snake extends Animal {\r\n    constructor(name: string) { super(name); }\r\n    move(distanceInMeters = 5) {\r\n        console.log(\"Slithering...\");\r\n        super.move(distanceInMeters);\r\n    }\r\n}\r\n\r\nclass Horse extends Animal {\r\n    constructor(name: string) { super(name); }\r\n    move(distanceInMeters = 45) {\r\n        console.log(\"Galloping...\");\r\n        super.move(distanceInMeters);\r\n    }\r\n}\r\n\r\nlet sam = new Snake(\"Sammy the Python\");\r\nlet tom: Animal = new Horse(\"Tommy the Palomino\");\r\n\r\nsam.move();\r\ntom.move(34);\r\n```\r\n\r\n```jsx\r\n//답안\r\n\r\n```\r\n\r\n\r\n\r\n## Q7. 타입스크립트에서 어떠한 클래스 혹은 함수에서 사용할 타입을 그 함수나 클래스를 사용할 때 결정하는 프로그래밍 기법은?\r\n\r\n- \r\n\r\n\r\n\r\n## Q8-1. 다음 두 가지 방법 중 어떤 방법이 컴포넌트 재사용성을 높일 수 있는 방법이라고 생각하는가? 그리고 그 이유는 무엇인가?\r\n\r\n```jsx\r\n// 1번\r\nclass Stack {\r\n  private data: any[] = [];\r\n\r\n  contructor() {}\r\n\r\n  push(item: any): void {\r\n    this.data.push(item);\r\n  }\r\n\r\n  pop(): any {\r\n    return this.data.pop();\r\n  }\r\n}\r\n```\r\n\r\n```jsx\r\n// 2번\r\n\r\nclass Stack<T> {\r\n  private data: T[] = [];\r\n\r\n  constructor() {}\r\n\r\n  push(item: T): void {\r\n    this.data.push(item);\r\n  }\r\n\r\n  pop() {\r\n    return this.data.pop();\r\n  }\r\n}\r\n```\r\n\r\n- \r\n\r\n\r\n\r\n## 08-2. 마지막 로그에 찍히는 numberStack과 stringStack의 데이터를 표기하시오.\r\n\r\n```jsx\r\nclass Stack<T> {\r\n  private data: T[] = [];\r\n\r\n  constructor() {}\r\n\r\n  push(item: T): void {\r\n    this.data.push(item);\r\n  }\r\n\r\n  pop() {\r\n    return this.data.pop();\r\n  }\r\n}\r\n\r\nconst numberStack = new Stack<number>();\r\nconst stringStack = new Stack<string>();\r\nnumberStack.push(1);\r\nnumberStack.push(2);\r\nnumberStack.push(3);\r\nstringStack.push('a');\r\nstringStack.push('b');\r\nnumberStack.pop();\r\nstringStack.pop();\r\nconsole.log(numberStack);\r\nconsole.log(stringStack);\r\n```\r\n\r\n```jsx\r\n// stringStack\r\n\"data\": [\r\n\r\n]\r\n\r\n// numberStack\r\n\"data\": [\r\n\r\n]\r\n```\r\n\r\n\r\n\r\n### 퀴즈에 대한 해설은 아래 노션 링크에서 확인할 수 있습니다!\r\n\r\n[퀴즈 답안 보러가기](https://www.notion.so/Typescript-7b44163f91fc411e978ecc0c3f527173)\r\n\r\n---\r\n\r\nReferences.\r\n\r\nhttps://typescript-kr.github.io/\r\n\r\nhttps://joshua1988.github.io/ts/");

